import './App.css';
import Main from './views/Main';
import { Router } from '@reach/router';
import NewPet from './views/NewPet';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <h1>Pet Shelter</h1>
      <Router>
        <Main path="/"/>
        <NewPet path="/pets/new"/>
      </Router>
    </div>
  );
}

export default App;
